// src/components/Projects.js
import React from "react";

function Projects() {
  return (
    <div className="projects">
      <h1>Projects</h1>
      <ul>
        <li>
          <strong>Project One:</strong> A React-based application that manages
          user tasks.
        </li>
        <li>
          <strong>Project Two:</strong> An interactive portfolio website built
          with React and styled-components.
        </li>
      </ul>
    </div>
  );
}

export default Projects;
